this.state = {
    USA: false,
    France: false,

}
}


    render (){
        return (
        <div>
            <label>Select A Country</label>
            <label>USA
            <input type='checkbox' checked={this.state.USA} name='USA' onChange={this.handleInputChange}/></label>
            <label>France
            <input type='checkbox' checked={this.state.France} name='France'/></label>

        </div>
        );
}
}

export default AppChild;
